    const expenseData = { ...enteredExpenseData, id: Math.random().toString() };

    console.log(expenseData);
  }

  return (
    <div className="new-expense">
      <ExpenseForm onSaveExpenseData={saveExpenseDataHandler} />
    </div>
  );
}
